import React from "react";

const Chart = ({ data }) => {
  return (
    <div className="w-100 h-100 pl-5 pt-5">
      {data.map((x, i) => {
        return (
          <div className={`h-18 my-2`}>
            <img src={x.item.image}></img>
            <div className={`w-${i * 20} bg-primary`}></div>
          </div>
        );
      })}
    </div>
  );
};

export default Chart;
